import React from "react";
import { Link } from "react-router-dom";

const Navbar = () =>
{
    return (
        <div className="navBar">
            {/* <div className="container"> */}
                <div className="backgroundImageOne"></div>
                <div className="links">
                    <Link className="link" to="../About">
                        About
                    </Link>
                </div>

            {/* </div> */}
        </div>
    )
}

export default Navbar
